import React, { useState } from 'react';
import { Route, Routes, useNavigate } from 'react-router-dom';
import CompanyRegister from './CompanyRegister';
import StudentPage from './studentpage';
import SCADPage from './scadpage';
import CompanyPage from './companypage';
import FacultyPage from './facultypage';

function App() {
  // Dummy users for login
  const dummyUsers = [
    {
      role: 'student',
      email: 'student@example.com',
      password: 'student123',
    },
    {
      role: 'scad',
      email: 'scad@example.com',
      password: 'scad123',
    },
    {
      role: 'company',
      email: 'company@example.com',
      password: 'company123',
    },
    {
      role: 'faculty',
      email: 'faculty@example.com',
      password: 'faculty123',
    },
  ];

  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const navigate = useNavigate();

  // Handle form submission for login
  const handleLogin = (e) => {
    e.preventDefault();

    const user = dummyUsers.find(
      (u) => u.email === email && u.password === password
    );

    if (user) {
      alert(`Logged in as ${user.role}`);
      navigate(`/${user.role}page`);
    } else {
      alert('Invalid email or password');
    }
  };

  const handleCompanyRegister = () => {
    navigate('/company-register');
  };

  return (
    <div>
      <Routes>
        {/* Login Page */}
        <Route
          path="/"
          element={
            <div style={{ display: 'flex', justifyContent: 'center', alignItems: 'center', height: '100vh' }}>
              <div style={{ padding: '20px', border: '1px solid #ddd', borderRadius: '8px' }}>
                <h2>Login</h2>
                <form onSubmit={handleLogin}>
                  <div>
                    <label htmlFor="email">Email:</label>
                    <input
                      type="email"
                      id="email"
                      name="email"
                      value={email}
                      onChange={(e) => setEmail(e.target.value)}
                      required
                      placeholder="Enter your email"
                      style={{ width: '100%', padding: '8px', marginBottom: '10px' }}
                    />
                  </div>
                  <div>
                    <label htmlFor="password">Password:</label>
                    <input
                      type="password"
                      id="password"
                      name="password"
                      value={password}
                      onChange={(e) => setPassword(e.target.value)}
                      required
                      placeholder="Enter your password"
                      style={{ width: '100%', padding: '8px', marginBottom: '10px' }}
                    />
                  </div>
                  <div style={{ display: 'flex', flexDirection: 'column', gap: '10px' }}>
                    <button type="submit" style={{ padding: '10px', backgroundColor: '#4CAF50', color: 'white', border: 'none', borderRadius: '4px' }}>
                      Login
                    </button>
                    <button type="button" onClick={handleCompanyRegister} style={{ padding: '10px', backgroundColor: '#FFA500', color: 'white', border: 'none', borderRadius: '4px' }}>
                      Register as a Company
                    </button>
                  </div>
                </form>
              </div>
            </div>
          }
        />

        {/* Other Pages */}
        <Route path="/company-register" element={<CompanyRegister />} />
        <Route path="/studentpage" element={<StudentPage />} />
        <Route path="/scadpage" element={<SCADPage />} />
        <Route path="/companypage" element={<CompanyPage />} />
        <Route path="/facultypage" element={<FacultyPage />} />
      </Routes>
    </div>
  );
}

export default App;
